import React from 'react';
import { Typography, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  // Define tus clases de estilo aquí
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: theme.spacing(2),
    color: theme.palette.primary.main, // Color primario
  },
  // Agrega más clases de estilo según sea necesario
}));

function Home() {
  const classes = useStyles();

  return (
    <div>
      {/* Aplica las clases de estilo a los elementos */}
      <Typography className={classes.title}>Bienvenido a la página de inicio</Typography>
      {/* Agrega otros elementos y estilos aquí */}
    </div>
  );
}

export default Home;
